import react from "react";
import { StatusBar } from 'expo-status-bar';


const HomePage = () => {
    <div  style={{display: "flex",backgroundColor: '#fff',alignItems: 'center',justifyContent: 'center',}}>
        <p>hello</p>
        <StatusBar style="auto" />
    </div>
}

export default HomePage;
